// SPDX-License-Identifier: MIT
pragma solidity >=0.4.4 < 0.7.0;
pragma experimental ABIEncoderV2;

contract notas {
    
    // Direccion del profesor
    address public professor;
    
    // Constructor 
    constructor () public {
        professor = msg.sender;
    }
    
    // Mapping para relacionar el hash de la identidad del alumno con su nota
    mapping (bytes32 => uint) Notes;
    
    // Array de los alumnos que pidan revisiones de examen
    string [] revisions;
    
    // Eventos 
    event evaluated_student(bytes32, uint);
    event revision(string);
    
    // Funcion para evaluar a alumnos
    function evaluate(string memory _studentId, uint _note) public professorUnique(msg.sender){
        // Hash de la identificacion del alumno 
        bytes32 hash_studentId = keccak256(abi.encodePacked(_studentId));
        // Relacion entre el hash de la identificacion del alumno y su nota
        Notes[hash_studentId] = _note;
        // Emision del evento
        emit evaluated_student(hash_studentId, _note);
    }
    

    modifier professorUnique(address _professorAddress){
        // Requiere que la direccion introducido por parametro sea igual al propietario del contrato
        require(_professorAddress == professor, "No tienes permisos para ejecutar esta funcion.");
        _;
    }
    
    // Funcion para ver las notas de un alumno 
    /*function VerNotas(string memory _idAlumno) public view returns(uint) {
        // Hash de la identificacion del alumno 
        bytes32 hash_idAlumno = keccak256(abi.encodePacked(_idAlumno));
        // Nota asociada al hash del alumno
        uint nota_alumno = Notas[hash_idAlumno];
        // Visualizar la nota 
        return nota_alumno;
    } 
    
    // Funcion para pedir una revision del examen
    function Revision(string memory _idAlumno) public {
        // Almacenamiento de la identidad del alumno en un array
        revisiones.push(_idAlumno);
        // Emision del evento 
        emit evento_revision(_idAlumno);
    }
    
    // Funcion para ver los alumnos que han solicitado revision de examen
    function VerRevisiones() public view UnicamenteProfesor(msg.sender) returns (string [] memory){
        // Devolver las identidades de los alumnos
        return revisiones;
    }*/
    
}

